import React from 'react'
import Navbar from './Components/Navbar'
import { BrowserRouter } from 'react-router-dom'
import { Routes } from 'react-router'
import { Route } from 'react-router'
import Home from './Components/Home'
import TicTacToe from './Components/TicTacToe';
import { findWinner } from './Redux/Winner/winnerAction';
import { updatePlayerData } from './Redux/PlayerProgress/updatePlayerDataAction'
import { useDispatch } from 'react-redux/es/exports';
import { useSelector } from 'react-redux/es/exports';

export default function App() {

  const winner = useSelector((state)=>{return state.winnerReducer})


  return (
    <BrowserRouter>

      <div className='font-monospace'>

        <Navbar />

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/TicTacToe" element={<TicTacToe winner={winner}/>} />
        </Routes>

      </div>

    </BrowserRouter>
  )
}
